syntax = "proto3";

package zproto;

import "stru_fish_record.proto";
import "stru_dirty_mask.proto";

message FishSetting {
    int32 baitId = 2;
    int32 experiences = 3;
    int32 researchFishId = 4;
    repeated zproto.FishSetting.FishRecordsEntry fishRecords = 5;
    repeated zproto.FishSetting.FishRodDurabilityEntry fishRodDurability = 6;
    uint64 rodUuid = 7;
    repeated zproto.FishSetting.LevelRewardEntry levelReward = 8;
    repeated zproto.FishSetting.ZeroFishTimesEntry zeroFishTimes = 9;
}
